import React, { useState, useEffect } from "react";
import axios from "axios";
import "./PalestinianReality.css";

const PalestinianReality = () => {
  const [newsItems, setNewsItems] = useState([]);

  useEffect(() => {
    const fetchNews = async () => {
      try {
        const response = await axios.get(
          "http://localhost:8000/api/news/palestinian_reality"
        );
        setNewsItems(response.data);
      } catch (err) {
        console.error(err);
      }
    };
    fetchNews();
  }, []);

  const regions = [
    {
      title: "الضفة الغربية",
      color: "#22c55e",
      stats: { population: "3.2M", unemployment: "26%" },
      updates: "اعتقالات في نابلس وجنين",
    },
    {
      title: "قطاع غزة",
      color: "#ef4444",
      stats: { population: "2.3M", unemployment: "47%" },
      updates: "أزمة كهرباء ومياه مستمرة",
    },
    {
      title: "فلسطين 48",
      color: "#3b82f6",
      stats: { population: "1.9M", unemployment: "18%" },
      updates: "قوانين تمييزية وعنصرية",
    },
    {
      title: "الشتات",
      color: "#8b5cf6",
      stats: { refugees: "6.4M", countries: "58", camps: "68" },
      updates: "مطلب أساسي وحق مقدس",
    },
  ];

  return (
    <section className="palestinian-reality">
      <div className="pr-header">
        <h2>الواقع الفلسطيني اليوم</h2>
        <p>تغطية شاملة للأوضاع السياسية والمعيشية في فلسطين والشتات</p>
      </div>

      <div className="pr-regions">
        {regions.map((region, i) => (
          <div key={i} className="pr-card">
            <div
              className="pr-card-header"
              style={{ backgroundColor: region.color }}
            >
              {region.title}
            </div>
            <div className="pr-card-body">
              {Object.entries(region.stats).map(([key, value], j) => (
                <div key={j} className="pr-card-stat">
                  <span>{key}</span>
                  <span>{value}</span>
                </div>
              ))}
              <div className="pr-card-updates">{region.updates}</div>
            </div>
          </div>
        ))}
      </div>

      <div className="pr-carousel-wrapper">
        <button className="pr-carousel-btn left">&lt;</button>
        <div className="pr-carousel">
          {newsItems.slice(0, 5).map((item, i) => (
            <div key={i} className="pr-carousel-item">
              <div className="image">
                <i className="fas fa-home"></i>
                <span className="badge">عاجل</span>
                <span className="time">منذ ساعتين</span>
              </div>
              <div className="content">
                <h3>{item.title}</h3>
                <p>{item.content.substring(0, 100)}...</p>
                <div className="footer">
                  <span>
                    <i className="fas fa-users"></i> 2.3M متأثر
                  </span>
                  <button>اقرأ التقرير</button>
                </div>
              </div>
            </div>
          ))}
        </div>
        <button className="pr-carousel-btn right">&gt;</button>
      </div>
    </section>
  );
};

export default PalestinianReality;
